r/>        <span style="color:#808000">@RequestParam</span>(name = <strong><span style="color:#008000">&quot;projectId&quot;</span></strong>, required = <strong><span style="color:#000080">false</span></strong>) Long projectId) {<br/>    String username = MDC.<em>get</em>(UserClient.<strong><em><span style="color:#660e7a">USER_NAME_KEY</span></em></strong>);<br/>    List&lt;Label&gt; labels = <strong><span style="color:#000080">this</span></strong>.<strong><span style="color:#660e7a">labelDaoJpa</span></strong>.getLabels(username)<br/>            .stream().map(label -&gt; label.toPresentationModel())<br/>            .collect(Collectors.<em>toList</em>());<br/>    String labelsEtag = EtagGenerator.<em>generateEtag</em>(EtagGenerator.HashAlgorithm.<strong><em><span style="color:#660e7a">MD5</span></em></strong>,<br/>            EtagGenerator.HashType.<strong><em><span style="color:#660e7a">TO_HASHCODE</span></em></strong>,<br/>            labels);<br/><br/>    HttpHeaders responseHeader = <strong><span style="color:#000080">new </span></strong>HttpHeaders();<br/>    responseHeader.setETag(labelsEtag);<br/>    <strong><span style="color:#000080">return </span></strong>ResponseEntity.<em>ok</em>().headers(responseHeader).body(labels);<br/>}</p>', 213);
